function initSliders() {
  $('.block5__footer').slick({
    slidesToShow: 1,
    slidesToScroll: 1,
    variableWidth: false,
    asNavFor: '.block5__header',
    dots: false,
    fade: true,
    arrows: false,
    touchMove: false,
    adaptiveHeight: true,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          arrows: false,
          infinite: true,
          centerMode: true
        }
      }
    ]
  });
  
  $('.block5__header').slick({
    slidesToShow: 3,
    slidesToScroll: 3,
    arrows: false,
    focusOnSelect: true,
    infinite: false,
    dots: false,
    variableWidth: true,
    asNavFor: '.block5__footer',
    responsive: [
      {
        breakpoint: 640,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          arrows: true,
          infinite: true,
          centerMode: true
        }
      }
    ]
  });
  
  $('.block7__slider').slick({
    slidesToShow: 3,
    slidesToScroll: 1,
    infinite: false,
    arrows: true,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1
        }
      },
      {
        breakpoint: 640,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          infinite: true
        }
      }
    ]
  });
  
  $(".text__scroll").mCustomScrollbar({
    theme:"my-theme",
    scrollEasing:"lineaar"
  });
}

if (document.documentElement.clientWidth < 480) {
  window.addEventListener('scroll', function () {
    setTimeout(initSliders, 1000);
  }, {
    once: true,
    passive: true
  });
} else {
  initSliders();
}

function initInputValidation() {
  const telFields = document.querySelectorAll('input[type="tel"]')

  for (let i = 0; i < telFields.length; i++) {
    telFields[i].addEventListener('input', validation)
  }

  function validation(event) {
    isNaN(event.data)
        ? this.value = this.value.replace(/[^0-9+]/, '')
        : false;
  }
}

initInputValidation();

window.addEventListener("load", function () {
  const popup = document.querySelector('.ever-popup');

  document.addEventListener('click', function () {
    if (popup && popup.classList.contains('show')) {
      initInputValidation();
    }
  })
});
